                price = price - offer.Percentage * price / 100;
            if (bag.Quantity > bag.Furniture.Quantity) bag.Quantity = (decimal)bag.Furniture.Quantity;
            price *= bag.Quantity;
            total += price;
        }
        return total;
    }
